import React from 'react'
import jobConfig from '../config/dashboards/jobConfig'
import { useQuery } from 'react-query'
import { job } from '../config/dashboards/jobConfig'

export default function JobDashboard() {

  //@ts-ignore
  const { data, status, isPreviousData, fetchNextPage, fetchPreviousPage,
  } = useQuery(["fetchData", 0], jobConfig.fetch)


  const fields = jobConfig.fields
  //     Object.keys(fields).map(fieldString=>console.log(fields[fieldString]))


  //  Object.keys(fields).map(fieldString => <th>{fields[fieldString].label}</th>)


  // data.forEach((element)=>{
  //  Object.keys(fields).map(fieldString=>console.log(element[fieldString]))}

  //<td>{e.startDate?.toDateString()}</td>
  //<td>{e.endDate?.toDateString()}</td>

  //<td>{e.requiredSkills}</td>
  //<td>{e.optionalSkills}</td>

  if (status === 'loading') return <h1>Loading...</h1>
  if (status === 'error') return <h1>There has been an error</h1>
  console.log(jobConfig)
  return (
    <table>
      {Object.keys(fields).map(fieldString => <th>{fields[fieldString].label}</th>)}
      {(data as job[]).map(e => <tr>
        <td>{e.id}</td>
        <td>{e.originalId}</td>
        <td>{e.talentId}</td>
        <td>{e.talentName}</td>
        <td>{e.talentGrade}</td>
        <td>{e.bookingGrade}</td>
        <td>{e.operatingUnit}</td>
        <td>{e.officePostalCode}</td>
        <td>{e.jobManagerName}</td>
        <td>{e.jobManagerId}</td>
        <td>{e.totalHours}</td>
        <td>{e.startDate?.toString()}</td>
        <td>{e.endDate?.toString()}</td>
        <td>{e.clientName}</td>
        <td>{e.clientId}</td>
        <td>{e.industry}</td>
        <td>{e.requiredSkills?.map(skill => <div>
          <h6>{skill.name}</h6>
        </div>)}</td>

        <td>{e.isUnassigned ? 'true' : 'false'}</td>
      </tr>)}
    </table>

  )
}
